import React from "react";

import Map from "ol/Map";
import layer from "ol/layer";
import OSM from "ol/source";
import proj from "ol/proj";

function Optic_Map() {
  const map = new Map({
    target: "map",
    layers: [
      new layer.Tile({
        source: new OSM()
      })
    ],
    view: new View({
      center: proj.fromLonLat([37.41, 8.82]),
      zoom: 4
    })
  });
  return <div className="Optic_Map" id="map"></div>;
}

export default Optic_Map;
